import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useParams } from 'react-router-dom';
import EstudiantesService from '../../Services/EstudianteServices';

function CrearEditarEstudiante() {
  const [estudianteData, setEstudianteData] = useState({
    primerApellido: '',
    segundoApellido: '',
    primerNombre: '',
    segundoNombre: '',
    correoElectronico: '',
    numeroTelefonico: '',
    password: '',
  });

  const [editing, setEditing] = useState(false);
  const { id } = useParams();
  const navigate = useNavigate();

  useEffect(() => {
    if (id) {
      setEditing(true);
      EstudiantesService.getEstudianteById(id)
        .then((response) => {
          const estudiante = response.data;
          setEstudianteData({
            primerApellido: estudiante.primerApellido,
            segundoApellido: estudiante.segundoApellido,
            primerNombre: estudiante.primerNombre,
            segundoNombre: estudiante.segundoNombre,
            correoElectronico: estudiante.correoElectronico,
            numeroTelefonico: estudiante.numeroTelefonico,
            password: estudiante.password,
          });
        })
        .catch((error) => {
          console.error('Error al obtener los datos del estudiante', error);
        });
    }
  }, [id]);

  const handleInputChange = (e) => {
    setEstudianteData({
      ...estudianteData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const estudianteDataToSend = {
      primerApellido: estudianteData.primerApellido,
      segundoApellido: estudianteData.segundoApellido,
      primerNombre: estudianteData.primerNombre,
      segundoNombre: estudianteData.segundoNombre,
      correoElectronico: estudianteData.correoElectronico,
      numeroTelefonico: estudianteData.numeroTelefonico,
      password: estudianteData.password,
    };

    if (editing) {
      EstudiantesService.updateEstudiante(id, estudianteDataToSend)
        .then((response) => {
          console.log('Estudiante actualizado con éxito', response.data);
          navigate('/estudiantes');
        })
        .catch((error) => {
          console.error('Error al actualizar el estudiante', error);
        });
    } else {
      EstudiantesService.createEstudiante(estudianteDataToSend)
        .then((response) => {
          console.log('Estudiante creado con éxito', response.data);
          navigate('/estudiantes');
        })
        .catch((error) => {
          console.error('Error al crear el estudiante', error);
        });
    }
  };

    return (
    <section className="vh-100">
      <div className="container py-5 h-100">
        <div className="row d-flex justify-content-center align-items-center h-100">
          <div className="col col-xl-10">
            <div className="card" style={{ borderRadius: '1rem' }}>
              <div className="row g-0">
                <div className="col-md-6 col-lg-5 d-none d-md-block">
                  <img
                    src="https://images.pexels.com/photos/4623357/pexels-photo-4623357.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
                    alt="login form"
                    className="img-fluid"
                    style={{ borderRadius: '1rem 0 0 1rem' }}
                  />
                </div>
                <div className="col-md-6 col-lg-7 d-flex align-items-center">
                  <div className="card-body p-4 p-lg-5 text-black">
                    <form onSubmit={handleSubmit}>
                      <div className="d-flex align-items-center mb-3 pb-1">
                        <i className="fas fa-cubes fa-2x me-3 logo"></i>
                        <span className="h1 fw-bold mb-0">Inicio de sesión</span>
                      </div>
                      <h5 className="fw-normal mb-3 pb-3" style={{ letterSpacing: '1px' }}>
                        {editing ? 'Editar Estudiante' : 'Crear Estudiante'}
                      </h5>
                      {/* Resto del formulario */}
                      <div className="form-outline mb-4">
                        <input
                          type="text"
                          id="primerApellido"
                          className="form-control form-control-lg"
                          name="primerApellido"
                          value={estudianteData.primerApellido}
                          onChange={handleInputChange}
                          required
                        />
                        <label className="form-label" htmlFor="primerApellido">
                          Primer Apellido
                        </label>
                      </div>
                      {/* Repite el bloque anterior para los demás campos */}
                      <div className="form-group mt-3 mb-3">
                        <button type="submit" className="btn btn-dark btn-lg btn-block btn-animated">
                          {editing ? 'Guardar Cambios' : 'Crear Estudiante'}
                        </button>
                      </div>
                    </form>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}
export default CrearEditarEstudiante;
